import React from "react";

import "./Footer.scss";

const Footer = () => {
  return (
    <footer>
      <div className="footer-line" />
      <div className="footer-buttons">
        <div className="footer-button">Contact us</div>
        <div className="footer-button">Terms of use</div>
        <div className="footer-button">Privacy policy</div>
      </div>
    </footer>
  );
};

export default Footer;
